nUpdateDB.DEDICATED_10M,u=30})}}),e(1602,{awp=30002,lore="A botanist in life, breeder and caretaker of arachnids in death, she oversees the spider wing, developing the most potent of poisons for the Lich King.",npcID=15953,u=30,g={ach(1997,{awp=30002,u=30,g={crit(7532,{achID=2137,awp=30002,id=11,u=30})}}),crit(5101,{achID=562,awp=30002,u=30}),crit(7147,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1603,{awp=30002,lore="Born deep within the mountains of Northrend many ages ago, she was captured within the dread citadel Naxxramas, where she gives birth to her brood, feeding them the corpses of all who dare venture too deeply into Naxxramas.",npcID=15952,u=30,g={ach(1858,{awp=30002,u=30,g={crit(7529,{achID=2137,awp=30002,id=4,u=30})}}),crit(5102,{achID=562,awp=30002,u=30}),crit(7148,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}})}}),h(-81,{awp=30002,u=30,g={e(1604,{awp=30002,lore="Responsible for the creation of the process that distills the souls of the living and places them within the cold cage of undeath, Noth was observed to be refining this process even now.",npcID=15954,u=30,g={crit(5104,{achID=566,awp=30002,u=30}),crit(7153,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30})}}),e(1605,{awp=30002,lore="The mastermind behind the plague cauldrons that turned the wilderness of Azeroth into the Plaguelands. It is said that Heigan has rigged the very walls and floors of Naxxramas itself with a vast array of traps, which he can trigger at will.",npcID=15936,u=30,g={ach(1996,{awp=30002,u=30,g={crit(7531,{achID=2137,awp=30002,id=5,u=30})}}),crit(5112,{achID=566,awp=30002,u=30}),crit(7154,{achID=578,awp=30002,OnUpdate=_.OnUpdateDB.DEDICATED_10M,u=30}),s(172363,39248,{awp=30002,b=1,description="This item was originally available in Naxxramas 10, but after H+ was introduced to Wrath Classic, it was removed.",f=6,isBounty=1,lvl=80,q=4,rwp=30401,u=2})}}),e(1606,{awp=30002,lore="The hideous result of fusing the living plag